    false,nt"url": null,nt"notes": "Stream surveys of the major salmon "runs"
    on Adak were conducted on a regular basis beginning in 1977. Their completion was
    dependent on time constraints and availability of personnel. Adak's salmon populations
    have not warranted more intensive studies because of the relatively low fishing
    pressure (Love 1976). However, the counts have yielded population trend data which
    can be used in the future when evaluating management programs. Counts of pink salmon
    (Oncorhynchus gorbuscha) were emphasized, although other species were noted as well.",nt"owner_org":
